module.exports = "<header>\n  <div class=\"container\">\n    <div class=\"header-title\">\n      <img src=\"assets/header-title.png\">\n      <p *ngIf=\"variables.eventBriteLinkActive\">\n        <a class=\"btn btn-success uppercase\" href=\"{{ variables.eventBriteLink}}\">Inscription</a>\n      </p>\n    </div>\n  </div>\n  <img class=\"header-footer\" src=\"assets/header-footer.png\">\n</header>\n\n<main>\n  <!-- keynote -->\n  <div class=\"keynote\">\n    <img class=\"keynote-header\" src=\"assets/keynote-header.png\">\n    <div class=\"container\">\n      <div class=\"row\">\n        <div class=\"col-sm-12 col-md-4 col-lg-3 text-center\">\n          <img class=\"keynote-picture\" src=\"assets/speakers/xavier-boilard.png\">\n        </div>\n        <div class=\"col-sm-12 col-md-8 col-lg-9\">\n          <h1 class=\"keynote-title text-primary\">Xavier Boilard</h1>\n          <h3 class=\"keynote-subtitle text-accent uppercase\">Omnimed</h3>\n          <p class=\"keynote-text\">\n              Pour cette seconde édition, nous avons le plaisir d'accueillir Xavier Boilard, \n              président-directeur général de l’entreprise Omnimed, une entreprise inspirante de la \n              région de l’Estrie.<br><br>\n              Fondée par le Dr Jean Boilard en 1984, la compagnie se nomme alors Caduceus et est \n              spécialisée dans le développement et la commercialisation d’outils de gestion pour les \n              cliniques médicales. <br><br>\n              Convaincu que le besoin en outils de gestion est beaucoup plus grand que ce qu’offre Caduceus, \n              il fonde alors Omnimed, en 1998. <br><br> \n              « Mon père disait que lorsqu'il avait commencé à pratiquer, la médecine était une science, \n              et que c'était devenu un art; celui de deviner ce que tu ne sais pas, car le patient ne \n              donne jamais toute l'information et le médecin a très rarement accès à toutes ses \n              consultations précédentes. À la fin de la journée, il était hanté par le doute, l'idée \n              qu'il avait pu se tromper et faire la mauvaise déduction. C'est pour réduire ce doute \n              qu'il a imaginé un dossier électronique partagé. » - Xavier Boilard, PDG d'Omnimed et \n              fils de Dr Boilard <br><br>\n              Depuis ses débuts, l’entreprise est l’une des pionnières sur le marché émergent de \n              l’informatique médicale au Québec et est devenue au fil des années leader en matière \n              de développement logiciel.\n          </p>\n        </div>\n      </div>\n    </div>\n    <img class=\"keynote-footer\" src=\"assets/keynote-footer.png\">\n  </div>\n\n  <!-- summary -->\n  <div class=\"summary\">\n    <div class=\"container\">\n      <div class=\"row\">\n        <div class=\"col-sm-12 col-md-8\">\n          <div>\n            <h1 class=\"title text-accent\">\n              <i class=\"material-icons icon-margin\">today</i>Événement\n            </h1>\n            <h3 class=\"text-primary bolder uppercase\">{{variables.eventDate}}</h3>\n            <h5 class=\"text-secondary bold uppercase\">{{variables.eventHours}}</h5>\n            <p>\n              Le Agile Tour Sherbrooke est un événement annuel offrant l'opportunité d'assister \n              a plusieurs conférences autour du sujet de la méthodologie Agile dans le domaine des TI.\n            </p>\n          </div>\n\n          <div>\n            <h1 class=\"title text-accent\">\n              <i class=\"material-icons icon-margin\">schedule</i>Horaire des conférences\n            </h1>\n            <p>\n              Le programme de la journée vous offre l'opportunité de participer à:\n            </p>\n            <ul>\n              <li>1 présentation principale de 90 minutes</li>\n              <li>3 conférences de 60 à 75 minutes, parmi un choix de 12 conférences et ateliers au programme</li>\n            </ul>\n            <p>\n              Que vous découvriez l'agilité ou que vous soyez expérimenté, vous aurez l'occasion d’y parfaire vos connaissances.\n            </p>\n\n            <p class=\"comeback-later bold\">\n              * Cliquez sur une conférence dans le tableau pour obtenir plus d'informations\n            </p>\n\n            <div #tableContainer>\n              <table>\n                <thead>\n                  <tr>\n                    <th></th>\n                    <th>{{ room.room1 }}</th>\n                    <th>{{ room.room2 }}</th>\n                    <th>{{ room.room3 }}</th>\n                    <th>{{ room.room4 }}</th>\n                  </tr>\n                </thead>\n                <tbody>\n                  <tr>\n                    <td>{{ conferenceKeynote.time }}</td>\n                    <td class=\"keynote clickable\" colspan=\"4\" (click)=\"openModal(conferenceKeynote)\">\n                      <div *ngIf=\"conferenceKeynote.enable\">\n                        <div class=\"title\">{{ conferenceKeynote.title }}</div>\n                        <div class=\"presenter\">{{ concatPresenters(conferenceKeynote.presenters) }}</div>\n                        <div class=\"company\">{{ conferenceKeynote.company }}</div>\n                      </div>\n                      <div *ngIf=\"!conferenceKeynote.enable\" class=\"title\" style=\"color: #888;\"><em>À venir</em></div>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td>10h30 à 10h45</td>\n                    <td colspan=\"4\">Pause</td>\n                  </tr>\n                  <tr>\n                    <td>{{ conferenceAm1[0].time }}</td>\n                    <td class=\"clickable\" *ngFor=\"let conference of conferenceAm1\" (click)=\"openModal(conference)\">\n                      <div *ngIf=\"conference.enable\">\n                        <div  class=\"title\">{{ conference.title }}</div>\n                        <div class=\"presenter\">{{ concatPresenters(conference.presenters) }}</div>\n                        <div class=\"company\">{{ conference.company }}</div>\n                      </div>\n                      <div *ngIf=\"!conference.enable\" class=\"title\" style=\"color: #888;\"><em>À venir</em></div>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td>12h00 à 13h00</td>\n                    <td colspan=\"4\">Dîner</td>\n                  </tr>\n                  <tr>\n                    <td>{{ conferencePm1[0].time }}</td>\n                    <td class=\"clickable\" *ngFor=\"let conference of conferencePm1\" (click)=\"openModal(conference)\">\n                      <div *ngIf=\"conference.enable\">\n                        <div class=\"title\">{{ conference.title }}</div>\n                        <div class=\"presenter\">{{ concatPresenters(conference.presenters) }}</div>\n                        <div class=\"company\">{{ conference.company }}</div>\n                      </div>\n                      <div *ngIf=\"!conference.enable\" class=\"title\" style=\"color: #888;\"><em>À venir</em></div>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td>14h15 à 14h30</td>\n                    <td colspan=\"4\">Pause</td>\n                  </tr>\n                  <tr>\n                    <td>{{ conferencePm2[0].time }}</td>\n                    <td class=\"clickable\" *ngFor=\"let conference of conferencePm2\" (click)=\"openModal(conference)\">\n                      <div *ngIf=\"conference.enable\">\n                        <div class=\"title\">{{ conference.title }}</div>\n                        <div class=\"presenter\">{{ concatPresenters(conference.presenters) }}</div>\n                        <div class=\"company\">{{ conference.company }}</div>\n                      </div>\n                      <div *ngIf=\"!conference.enable\" class=\"title\" style=\"color: #888;\"><em>À venir</em></div>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td>15h45 à 16h00</td>\n                    <td class=\"closure\" colspan=\"4\">Mot de la fin</td>\n                  </tr>\n                </tbody>\n              </table>\n            </div>\n            <div class=\"visible-xs\">\n              <em>Vous pouvez consulter le tableau en vous déplaçant de gauche à droite avec le mode touch de votre appareil mobile</em>\n            </div>\n          </div>\n        </div>\n\n        <div class=\"col-sm-12 col-md-4\">\n          <h1 class=\"title text-accent\">\n            <i class=\"material-icons icon-margin\">location_on</i>Emplacement\n          </h1>\n          <h3 class=\"text-primary bolder uppercase\">Université de Sherbrooke</h3>\n          <div>\n          <a class=\"text\" href=\"https://www.google.ca/maps/place/Facult%C3%A9+de+G%C3%A9nie/@45.3675646,-71.9772254,14z/data=!4m5!3m4!1s0x0:0xb57db3c0731d863d!8m2!3d45.3783419!4d-71.9256972\" target=\"_blank\">\n              Falcuté de Génie<br>\n              2500, boul. de l'Université<br>\n              Sherbrooke (Québec) J1K 2R1              \n          </a>\n          </div>\n          <h5 class=\"include\" style=\"font-weight:bold;\">L'accueil se fera à la cafétéria du pavillon</h5>\n        </div>\n\n        <div class=\"col-sm-12 col-md-4\">\n          <h1 class=\"title text-accent\">\n            <i class=\"material-icons\">attach_money</i>Admission\n          </h1>\n          <h3 class=\"text-primary bolder uppercase\">{{ variables.eventPrice}}</h3>\n          <h4>Spécial Étudiant : 25$</h4>\n          \n\n          <h5 class=\"include\"><b>Inclus</b></h5>\n          <ul>\n              <li>Laissez-passer pour la journée</li>\n              <li>Dîner</li>\n              <li>Collation et café</li>\n              <li>Stationnement</li>\n          </ul>\n          <br>\n          <p *ngIf=\"variables.eventBriteLinkActive\">\n            <a class=\"btn btn-success uppercase\" href=\"{{ variables.eventBriteLink}}\">Inscription</a>\n          </p>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <!-- partners -->\n  <div class=\"partners text-center\">\n    <img class=\"partners-header\" src=\"assets/partners-header.png\">\n    <div class=\"container\">\n\n      <h1 class=\"partners-title\">Partenaires Platine</h1>\n      <hr class=\"partner-divider\">\n      <div class=\"row\">\n        <div class=\"col-sm-12\">\n          <a href=\"http://pyxis-tech.com/fr/\" target=\"_blank\">\n            <img class=\"partners-pyxis\" src=\"assets/partners/pyxis-white-logo.png\">\n          </a>\n        </div>\n        <div class=\"col-sm-12\">\n          <a href=\"https://sherbrooke-innopole.com/fr/\" target=\"_blank\">\n            <img class=\"partners-innopole\" src=\"assets/partners/sherbrooke-innopole-white-logo.png\">\n          </a>\n        </div>\n        <div>&nbsp;<br><br></div>\n        <h1 class=\"partners-title\">Partenaires Or</h1>\n        <hr class=\"partner-divider\">\n        <div class=\"col-sm-12\">\n          <a href=\"https://www.facilite.com/\" target=\"_blank\">\n            <img class=\"partners-genetec\" src=\"assets/partners/facilite-white-logo.png\">\n          </a>\n        </div>\n        <div class=\"col-sm-12\">\n          <a href=\"https://www.genetec.com/\" target=\"_blank\">\n            <img class=\"partners-genetec\" src=\"assets/partners/genetec-white-logo.png\">\n          </a>\n        </div>\n\n        <div class=\"col-sm-12\">\n          <a href=\"https://www.levio.ca/\" target=\"_blank\">\n            <img class=\"partners-levio\" src=\"assets/partners/levio-white-logo.png\">\n          </a>\n        </div>\n      </div>\n      <div class=\"col-sm-12\">\n        <a href=\"http://usherbrooke.ca\" target=\"_blank\">\n          <img class=\"partners-udes\" src=\"assets/partners/udes-white-logo.png\">\n        </a>\n      </div>\n\n    </div>\n  </div>\n</main>\n\n<footer>\n</footer>"

